import React, { useContext } from "react";
import { UniversalContext } from "./App";
import NavTop from "./NavTop";
import Footer from "./Footer";

function ProjectListItem(props) {
  // console.log('props',props)
  const projectContext = useContext(UniversalContext);
  // console.log("project context", projectContext.projects);
  const data = projectContext.projects;
  console.log("proJects", data);
  console.log("proJects", data.feed);
  let singleProject = this;

  if (data.feed) {
    const singleProject = data.feed.entry.map((project, index) => {
      console.log("data.feed.entry", data.feed.entry);
      if (project.title === props.match.params.title) {

        return (

          <div>
            <div className="project-project" key={index} alt="he">
              <div className="project-title">
                <p>{project.gsx$title.$t}</p>
                <img src={project.gsx$image.$t} alt="users"></img>
              </div>
            </div>
          </div>
        );
      }
    });
  }
  // console.log("props.match.params", singleProject);
  return (
    <div className="login">
      <NavTop />

      <div>{singleProject}</div>
      <Footer />
    </div>
  );
}

export default ProjectListItem;
